import React from 'react';
import './index.css';

export class AboutViewer extends React.Component {
    constructor(props) {
        super(props);
        this.state = {
            compName: "About"
        }
    }

    render() {
        return (<div className="mainWrapper"><div class="about jumbotron">
            <h1 class="display-4">Awesome Task Manager</h1>
            <p class="lead">By Gabriel C. Ullmann</p>
            <hr class="my-4"></hr>
            <a href="https://github.com/nkinesis" target="_blank">https://github.com/nkinesis</a>
      </div></div>);
    }

}

export default AboutViewer;
